import React from 'react';
import axios from 'axios';

const UsersList = async () => {

  async function getUsers(){
    const response = await axios.get('http://localhost:5000/users');
    console.log(response);
  }

  return (
    <div>
      <h1>UsersList</h1>
    </div>
  )
}

export default UsersList
